import React from 'react';

import Link from "next/link"

function Index() {
    return (
        <div>
            <nav>
                <ul>
                    <li><Link href="/"><a > Home </a></Link></li>
                    <li><Link href="/about"><a > About </a></Link></li>
                    <li><Link href="/contact"><a > Contact </a></Link></li>
                </ul>
            </nav>
            Home Page
        </div>
    );
}

export default Index;
